import './App.css';

function App() {
  return (
   <div>
    <input type='email' value="email" placeholder='Email'></input>
    <input type='text' value="Name" placeholder='Name'></input>
    <input type='password' value="Pass" placeholder='Password'></input>
    <input type='password' value="confirm " placeholder='confirm password'></input>


   </div>
  );
}

export default App;
